import React, { useState } from 'react';
import {
  Card,
  CardContent,
  TextField,
  Button,
  Typography,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Box,
  Autocomplete,
  FormHelperText,
  Alert,
  Divider
} from '@/components/ui/card';
import { Search } from 'lucide-react';

const ForumPost = ({ onSubmit, onCancel }) => {
  const [formData, setFormData] = useState({
    title: '',
    content: '',
    category: '',
    bookId: null,
    showInNewsfeed: true
  });

  const [selectedBook, setSelectedBook] = useState(null);
  const [error, setError] = useState('');

  const categories = [
    "General Discussion",
    "Book Reviews",
    "Reading Challenges",
    "Author Discussions",
    "Book Recommendations",
    "Reading Groups",
    "Writing",
    "Poetry"
  ];

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.title.trim()) {
      setError('Please enter a title for your discussion');
      return;
    }

    if (!formData.category) {
      setError('Please select a category');
      return;
    }

    if (!formData.content.trim()) {
      setError('Please enter some content for your discussion');
      return;
    }

    onSubmit({
      ...formData,
      bookInfo: selectedBook
    });
  };

  return (
    <Card className="w-full max-w-3xl mx-auto mt-4">
      <CardContent className="p-6">
        <Typography variant="h5" className="font-bold mb-6">
          Start a New Discussion
        </Typography>

        {error && (
          <Alert variant="destructive" className="mb-4">
            {error}
          </Alert>
        )}

        <form onSubmit={handleSubmit} className="space-y-6">
          {/* Category Selection */}
          <FormControl className="w-full">
            <InputLabel>Select Category *</InputLabel>
            <Select
              value={formData.category}
              onChange={(e) => setFormData({ ...formData, category: e.target.value })}
              className="w-full"
            >
              {categories.map((category) => (
                <MenuItem key={category} value={category}>
                  {category}
                </MenuItem>
              ))}
            </Select>
            <FormHelperText>
              Choose the most relevant category for your discussion
            </FormHelperText>
          </FormControl>

          {/* Title */}
          <TextField
            label="Discussion Title *"
            value={formData.title}
            onChange={(e) => setFormData({ ...formData, title: e.target.value })}
            className="w-full"
            helperText="Make your title specific and descriptive"
          />

          {/* Book Search */}
          <Box className="w-full">
            <Typography variant="subtitle2" className="mb-2">
              Add a Book (Optional)
            </Typography>
            <Autocomplete
              options={[]} // Would be populated with book search results
              getOptionLabel={(option) => option.title}
              onChange={(_, newValue) => setSelectedBook(newValue)}
              renderInput={(params) => (
                <TextField
                  {...params}
                  label="Search for a book"
                  InputProps={{
                    ...params.InputProps,
                    startAdornment: <Search className="w-5 h-5 text-gray-400 mr-2" />
                  }}
                />
              )}
            />
          </Box>

          {/* Content */}
          <div>
            <TextField
              label="Discussion Content *"
              multiline
              rows={6}
              value={formData.content}
              onChange={(e) => setFormData({ ...formData, content: e.target.value })}
              className="w-full"
              helperText="Share your thoughts, questions, or ideas"
            />
          </div>

          <Divider className="my-4" />

          {/* Action Buttons */}
          <Box className="flex justify-end space-x-4">
            <Button
              variant="outline"
              onClick={onCancel}
              className="px-6"
            >
              Cancel
            </Button>
            <Button
              type="submit"
              className="bg-green-600 hover:bg-green-700 text-white px-6"
            >
              Create Discussion
            </Button>
          </Box>
        </form>
      </CardContent>
    </Card>
  );
};

export default ForumPost;
